import { useEffect, useState } from 'react'
import Device from './Device'

const DeviceList = () => {
  const [devices, setDevicces] = useState([])
  useEffect(() => {
    fetch("http://127.0.0.1:8080/devices")
    .then(res => {
      return res.json()
    })
    .then(json => {
      console.log(json)
    })
  }, [])

  return (
    <div className="flex p-8 w-full gap-x-4">
      {
        devices &&
          devices.map((device: any) => {
            return <Device deviceId={device} />
          })
      }
    </div>
  )
}

export default DeviceList
